import { useEffect, useState } from 'react';
import './App.css';
import ArtistList from './components/ArtistList.js';
import AlbumList from './components/AlbumList.js';
import GenreList from './components/GenreList.js';
import Accueil from './components/Accueil.js';



function App() {

    const [page, setPage] = useState(1);
    const [where, setWhere] = useState('artists');

    function prevPage() {
        if (page === 1) {
            return;
        }
        setPage(page - 1);
    }

    function nextPage() {
        setPage(page + 1);
    }

    switch (where){
        case 'homepage':
            return (
                <>
                    <div class="navbar">
                        <li><button class="nav-links" onClick={()=>{setWhere('homepage'); setPage(1)}}>HOMEPAGE</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('artists'); setPage(1)}}>ARTISTS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('albums'); setPage(1)}}>ALBUMS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('genres'); setPage(1)}}>GENRES</button></li>
                    </div>

                    <div class='content'><Accueil /></div>
                </>
            );
        case 'artists':
            return (
                <>
                    <div class="navbar">
                        <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
                    </div>

                    <div class='content'><ArtistList /></div>
                </>
            );
        case 'albums':
            return (
                <>
                    <div class="navbar">
                        <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
                    </div>

                    <div class='content'><AlbumList /></div>
                </>
            );
        case 'genres':
            return (
                <>
                    <div class="navbar">
                        <li><button class="nav-links" onClick={()=>{setWhere('homepage')}}>HOMEPAGE</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('artists')}}>ARTISTS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('albums')}}>ALBUMS</button></li>
                        <li><button class="nav-links" onClick={()=>{setWhere('genres')}}>GENRES</button></li>
                    </div>

                    <div class='content'><GenreList /></div>
                </>
            );
    }
}

export default App;
